import React from "react";
import { navigate } from "@reach/router";
import logo from "../media/logo.png";
import "../App.css";
import "../Anime.scss";
export default function Landing() {
  return (
    <div className="bg">
      <div className="container">
        <img src={logo} className="land-logo" alt="Logo" />
        <br />
        <div class="section three">
          <div id="button" onClick={nav}>
            Enter
            <div class="ring one"></div>
            <div class="ring two"></div>
            <div class="ring three"></div>
            <div class="ring four"></div>
          </div>
        </div>
        <div className="row banner">
            <div className="banner-text">
            <img src={logo} className="logo-size" alt="Logo" />
               <h1 className="responsive-headline">{resumeData.name}</h1>
               <hr/>
               <ul className="social">
                  {resumeData.socialLinks && resumeData.socialLinks.map(item =>{
                    return(<li key={item.name}> <a href={item.url} rel="noopener noreferrer" target="_blank"><i className={item.className}></i></a> </li>)})}
               </ul>
            </div>
         </div>
        <br />
      </div>
    </div>
  );
}

function nav() {
  navigate("/home");
  return window.location.reload(false);
}
